function ApplyPlaterSettings()
	local settings = GetPlaterSettings()

	if IsAddOnLoaded("Plater") then
		if not PlaterDB then
			print("Plater saved variables not found")
			return
		end

		local profileName = "PeaversUI"
		local encodedProfileString = settings

		local data = Plater.DecompressData(encodedProfileString, 'print')

		PlaterDB = PlaterDB or {}
		PlaterDB.profiles = PlaterDB.profiles or {}

		PlaterDB.profiles[profileName] = data

		-- Set the current profile
		PlaterDB["currentProfile"] = profileName

		-- Apply the profile
		if Plater and Plater.db then
			Plater.db:SetProfile(profileName)
		end

		-- Refresh Plater
		if Plater.RefreshConfig then
			Plater.RefreshConfig()
		end

		-- Update all nameplates
		if Plater.UpdateAllPlates then
			Plater.UpdateAllPlates()
		end

		print("PeaversUI Plater profile applied and set as current")
	else
		print("Plater addon is not loaded")
	end
end
